import React from 'react';
import CardBoard from "./components/cardBoard";

function App() {
  return (
    <div className="App">
        <div className='container-fluid vertical-center'>
          <div className="row justify-content-center">
              <div className=" mx-auto  text-center">
                  <CardBoard/>
              </div>
              {/* /.text-center */}

          </div>
        </div>

      {/* /.row */}
    </div>
  );
}

export default App;
